  input: TEXT,F3XA,,"The amendment is filed in response to the Commissions' preliminary
    review letter dated July 11, 2007.  Republican Federal Committee of PA pays for
    administrative, generic voter drive and exempt activity expenses from our federal
    account and allocates between the federal and non-federal account according to
    our fixed percentage ratio indicated on Schedule H1.  If we are short on non-federal
    dollars, the indicated activities are not allocated between accounts but paid
    for with 100% federal dollars.  RFC of PA makes an allocation transfer for the
    non-federal portion of allocable disbursements within the 70-day time period,
    generally 60 days after the payment to the vendor.  Fundraising expenses are generally
    paid for with 100% federal dollars and reported on Line 21B of the summary page.  If
    fundraising expenses are allocated between the federal and non-federal account,
    RFC of PA uses the funds received method for determining the allocation of expenses.
    Expenses that are 100% non-federal in nature are paid out of our non-federal account.  "
